(function(){Vue.component("convos-help",{props:["user"],template:"<div class=\"convos-help is-sidebar\">\n    <header>\n      <convos-toggle-main-menu :user=\"user\"></convos-toggle-main-menu>\n      <convos-header-links :user=\"user\"></convos-header-links>\n    </header>\n    <div class=\"content\">\n      <div class=\"row\">\n        <div class=\"col s12\">\n          <h5 v-if=\"!isTouchDevice\">Shortcuts</h5>\n          <p v-if=\"!isTouchDevice\">These shortcuts are not yet implemented.</p>\n          <dl v-if=\"!isTouchDevice\">\n            <dt>shift+enter</dt>\n            <dd>Shift focus between chat input and dialog sidebar.</dd>\n            <dt>tab (When writing a message)</dt>\n            <dd>Will autocomplete a command, nick or channel name.</dd>\n          </dl>\n          <h5>Available commands</h5>\n          <p>Commands are not yet supported.</p>\n          <dl>\n            <dt><a @click.prevent=\"insertIntoInput\" href=\"#/help\">/help</a></dt>\n            <dd>Show this help dialog.</dd>\n            <dt><a @click.prevent=\"insertIntoInput\" href=\"#/close\">/close [&lt;nick&gt;]</a></dt>\n            <dd>Close conversation with nick, defaults to current active.</dd>\n            <dt><a @click.prevent=\"insertIntoInput\" href=\"#/join\">/join &lt;#channel&gt;</a></dt>\n            <dd>Join channel and open up a chat window.</dd>\n            <dt><a @click.prevent=\"insertIntoInput\" href=\"#/kick\">/kick &lt;nick&gt;</a></dt>\n            <dd>Kick a user from the current channel.</dd>\n            <dt><a @click.prevent=\"insertIntoInput\" href=\"#/me\">/me &lt;message&gt;</a></dt>\n            <dd>Send message as an action.</dd>\n            <dt><a @click.prevent=\"insertIntoInput\" href=\"#/msg\">/msg &lt;nick&gt;</a></dt>\n            <dd>Send a direct message to nick.</dd>\n            <dt><a @click.prevent=\"insertIntoInput\" href=\"#/nick\">/nick &lt;nick&gt;</a></dt>\n            <dd>Change your wanted nick.</dd>\n            <dt><a @click.prevent=\"insertIntoInput\" href=\"#/part\">/part &lt;#channel&gt;</a></dt>\n            <dd>Leave channel, and close window.</dd>\n            <dt><a @click.prevent=\"insertIntoInput\" href=\"#/query\">/query &lt;nick&gt;</a></dt>\n            <dd>Open up a new chat window with nick.</dd>\n            <dt><a @click.prevent=\"insertIntoInput\" href=\"#/reconnect\">/reconnect</a></dt>\n            <dd>Restart the current connection.</dd>\n            <dt><a @click.prevent=\"insertIntoInput\" href=\"#/say\">/say &lt;message&gt;</a></dt>\n            <dd>Used when you want to send a message starting with &quot;/&quot;.</dd>\n            <dt><a @click.prevent=\"insertIntoInput\" href=\"#/topic\">/topic &lt;#channel&gt; [&lt;new topic&gt;]</a></dt>\n            <dd>Show current topic, or set a new one.</dd>\n            <dt><a @click.prevent=\"insertIntoInput\" href=\"#/whois\">/whois &lt;nick&gt;</a></dt>\n            <dd>Show information about a user.</dd>\n          </dl>\n          <h5>Resources</h5>\n          <ul>\n            <li><a href=\"http://convos.by\" target=\"_blank\">Project homepage</a></li>\n            <li><a href=\"https://github.com/Nordaaker/convos/issues\" target=\"_blank\">Bug/issue tracker</a></li>\n            <li><a href=\"https://github.com/Nordaaker/convos\" target=\"_blank\">Source code</a></li>\n          </ul>\n          <p>\n            It is also possible to chat with us in the &quot;#convos&quot; channel on\n            <a href=\"http://freenode.net/\" target=\"_blank\">irc.freenode.net</a>.\n          </p>\n        </div>\n      </div>\n    </div>\n  </div>\n"})})();